import '../style/category.css'
import { makeStyles, Grid, Card, CardMedia, CardContent, Typography } from '@material-ui/core';



const useStyles = makeStyles({
    gridContainer: {
      paddingLeft: "40px",
      paddingRight: "40px",
      background:"#7555D9",
      height:"100vh"
    },
      cardImg:{
            float:"left",
            padding:"20px",
            width:"80px"
      },
  });

function UserCategory() {
    const classes = useStyles();
  return (
    <Grid
      container
      spacing={4}
      className={classes.gridContainer}
      justify="center"
    >
      <Grid item xs={12} sm={6} md={3}>
      <h3 className="text1">Choose your</h3>
      <h3 className="text2">Category</h3>
      </Grid>
      <Grid
      container
      spacing={4}
      className={classes.gridContainer}
      justify="center"
    >
      <Grid item xs={12} sm={6} md={6}>
      <Card className={classes.root}>
      <div className={classes.details}>
             <img className={classes.cardImg} src="/assets/image/2.png"/>
        <CardContent>
          <h3 className="content">
          2021 FRIENDSHIP DARE
          </h3>

        </CardContent>
      </div>

    </Card>
      </Grid>
      </Grid>
    </Grid>
  );
}

export default UserCategory
